import React, { useState, useEffect } from 'react';

function App() {
  const [isAuthenticated, userHasAuthenticated] = useState(false);

  return !isAuthenticated ? (
    <>
      <h1>Hello, World!</h1>
    </>
  ) : (
    <>
      <h1>Hello, User!</h1>
    </>
  );
}

export default App;
